import { formatTime } from "../helpers/helpers";

const Timer = (label, time) => (
  <div className="timer">
    <label className="timer__label">{this.props.label}</label>
    <h2 className="timer__clock">{formatTime(this.props.time)}</h2>
  </div>
);

export default Timer;
